import Accordion from "react-bootstrap/Accordion";
import Permission from "./Permisson";
import { Container, Table } from "react-bootstrap";

function AccordionFN({item,index}){

    return(<>
        <Accordion key={index}>
        <Accordion.Item eventKey={index}>
          <Accordion.Header>{item.title}</Accordion.Header>
          <Accordion.Body>
          {item.subSection?.map((subitem, index1) => {
                  return (

                    <Accordion key={index1}>
                      <Accordion.Item eventKey={index1}>
                        <Accordion.Header>{subitem.title}</Accordion.Header>
                        <Accordion.Body>
                          {subitem.subSection?.map((mainitem, index2) => {
                            return <AccordionFN item={mainitem} index={index2} />
                          })}
                        </Accordion.Body>
                      </Accordion.Item>
                    </Accordion>
                  );
                })}
          </Accordion.Body>
        </Accordion.Item>
      </Accordion>
      <Container>
      <Table>
        <thead>
          <tr>
            <th>Permission Name</th>
            <th></th>
            <th>ADD/EDIT</th>
            <th>Delete</th>
          </tr>
        </thead>
        <Permission Menuitem={item}/>
      </Table>
    </Container>

      </>
    )
}
export default AccordionFN
